(5, 'Terms and Conditions', 'terms-and-conditions', '<p>TERMS AND CONDITIONS</p>\r\n<p>Introduction</p>\r\n<p>By accessing this web site, you are agreeing to be bound by these web site Terms and Conditions of Use, all applicable laws and regulations, and agree that you are responsible for compliance with any applicable local laws. If you do not agree with any of these terms, you are prohibited from using or accessing this site. The materials contained in this web site are protected by applicable copyright.</p>\r\n<p>We may change these conditions at any time without notice.</p>\r\n<p>&nbsp;</p>\r\n<p>Copyright</p>\r\n<p>You may not use the AUSPERA INDIA PVT. LTD. sites for any unlawful purpose. You may not reproduce, publish, broadcast, transmit, modify, adapt, create derivative works of, store, archive or in any way commercially exploit any of the content. Without limitation, you may not do any of the following without prior written permission from AUSPERA INDIA PVT. LTD.</p>\r\n<p>Third Party Products and Services</p>\r\n<p>The AUSPERA INDIA PVT. LTD. sites may contain links to other Internet websites or online and mobile services provided by independent third parties (\"Third party sites\"), either directly or through frames. AUSPERA INDIA PVT. LTD. is not responsible for the availability or content of Third party sites and will not be a party to, or in any way responsible for, any transaction concerning goods or services available from such Third party sites.</p>\r\n<p>You may not link any other web-site to this Site without obtaining our prior written consent.</p>\r\n<p>&nbsp;</p>\r\n<p>No Warranty</p>\r\n<p>Although we have taken all reasonable care to ensure that the information provided on this Site is accurate, we give no warranties of any kind, express or implied, with regard to its accuracy or completeness.</p>\r\n<p>&nbsp;</p>\r\n<p>No Liability</p>\r\n<p>We will not be liable for any damages or direct or indirect loss in connection with your use of, or inability to use the Site or any failure or delay by us in performing our obligations. This includes any loss of profit, income or business opportunity together with any loss arising from any computer virus or system failure.</p>\r\n<p>We may modify, withdraw or suspend the Site or any part of it without notice at any time.</p>\r\n<p>&nbsp;</p>\r\n<p>Governing Law</p>\r\n<p>Indian law governs these conditions and you agree that the Courts of Chennai shall have exclusive jurisdiction to determine any matter or dispute arising out of this Site and these conditions. This Site is directed solely at individuals in India. If you choose to access this Site from other locations it is your responsibility to comply with all applicable local laws.</p>\r\n<p>&nbsp;</p>\r\n<p>Contact Information</p>\r\n<p>AUSPERA INDIA PRIVATE LIMITED</p>\r\n<p>127, NSC BOSE ROAD, SOWCARPET</p>\r\n<p>CHENNAI-600003</p>\r\n<p>&nbsp;ph-044-48656229 , e: info@silvera.co.in</p>\r\n<p><a href=\"www.silvera.co.in\">www.silvera.co.in</a></p>\r\n<p>&nbsp;</p>\r\n<p>SHIPPING POLICY</p>\r\n<p>AUSPERA INDIA PRIVATE LIMITED</p>\r\n<p>offers shipping on every product to its customers residing within India through our tie ups with the top most logistics companies like Blue Dart , BVC LOGISTICS etc. To ensure optimum safety and a hassle free online shopping experience, all our shipments are insured till it reaches your doorstep.</p>\r\n<p>&nbsp;</p>\r\n<p>All our products are specially packaged in travel-safe, tamper-proof packing and utmost care is taken at every stage to ensure that the product reaches your hands in perfect condition. We request our customers to thoroughly check the parcel before signing any receipt. Once receipt is signed by the Customer, the Customer cannot dispute and/or make claim about the quality, quantity and /or any other aspect of the product</p>\r\n<p>&nbsp;</p>\r\n<p>EXCHANGE / BUY BACK POLICY</p>\r\n<p>MMTC PAMP 999.9 GOLD COINS - 97 % OF THE FAIR MARKET PRICE</p>\r\n<p>MMTC PAMP 999.9/999.0 SILVER COINS - 98 % OF THE DAILY SPOT RATES UPDATED ON OUR WEBSITE</p>\r\n<p>SILVERA 999.0 SILVER COINS / BARS - 98 % OF THE DAILY SPOT RATES UPDATED ON OUR WEBSITE</p>\r\n<p>NOTE - SHIPPING&nbsp; &amp; INSURANCE COST &amp; RISK TO BE BORNE BY THE SENDER OF THE PRODUCT UNTIL IT REACHES THE BUYER ( AUSPERA INDIA PVT. LTD. ) BUSINESS PREMISES&nbsp; &amp; PRODUCT SHOULD BE ACCOMPANIED WITH ORIGINAL INVOICE</p>\r\n<p>* FAIR MARKET PRICE WILL BE DECIDED ON THE BASIS OF DEMAND AND SUPPLY .</p>\r\n<p>DISCLAIMER POLICY</p>\r\n<p>AUSPERA INDIA PRIVATE LIMITED</p>\r\n<p>and their respective publishers, authors, agents and employees have done their best to ensure the accuracy and currency of all the information on this website contributed by them; however, they accept no responsibility for any loss, injury, or damages sustained by anyone as a result of information or advice contained on the site nor for the results of any travel arrangement originating from this site. The use of information on or derived from this site and any arrangement for travel with person\'s contacted through the site is made at the user\'s own risk. We encourage you to verify any critical information with the relevant authorities before you travel. This includes information on visa requirements, health and safety, customs, and transportation.</p>\r\n<p>&nbsp;</p>\r\n<p>AUSPERA INDIA PRIVATE LIMITED</p>\r\n<p>and their respective publishers, authors, agents and employees make no representations about the suitability of the information contained in the documents and related graphics published on this website for any purpose. All such documents and related graphics are provided \'\'as is\'\' without warranty of any kind, statutory or otherwise. AUSPERA INDIA PRIVATE LIMITED</p>\r\n<p>and their respective publishers, authors, agents and employees disclaim all warranties and conditions with regard to this internet site and the information contained therein, including, without limitation, all implied warranties and conditions of merchantability, fitness for a particular purpose, title, and non-infringement. In no event shall AUSPERA INDIA PRIVATE LIMITED</p>\r\n<p>and their respective publishers, authors, agents and employees, be liable for any special, indirect, or consequential damages or any damages whatsoever whether in an action of contract, negligence, or other tortuous action, arising out of or in connection with the use or performance of this internet site or of the information and documents contained therein, provision of or failure to provide services, or any other information directly or indirectly available from this website.</p>', 'N', 0, 1, '2020-06-09 14:02:53', '2020-07-17 13:51:15', 'Terms and Conditions', 'Terms and Conditions 1', 'Terms and Conditions 2'),
(6, 'Shipping and Delivery', 'shipping-and-delivery', '<p>SHIPPING POLICY</p>\r\n<p>AUSPERA INDIA PRIVATE LIMITED</p>\r\n<p>offers shipping on every product to its customers residing within India through our tie ups with the top most logistics companies like Blue Dart , BVC LOGISTICS etc. To ensure optimum safety and a hassle free online shopping experience, all our shipments are insured till it reaches your doorstep.</p>\r\n<p>&nbsp;</p>\r\n<p>All our products are specially packaged in travel-safe, tamper-proof packing and utmost care is taken at every stage to ensure that the product reaches your hands in perfect condition. We request our customers to thoroughly check the parcel before signing any receipt. Once receipt is signed by the Customer, the Customer cannot dispute and/or make claim about the quality, quantity and /or any other aspect of the product.</p>', 'N', 0, 1, '2020-06-08 11:01:00', '2022-11-04 11:43:29', 'Shipping and Delivery', 'Shipping and Delivery', 'Shipping and Delivery'),
(7, 'Privacy Policy', 'privacy-policy', '<p>PRIVACY POLICY</p>\r\n<p>This Privacy Policy governs the manner in which AUSPERA INDIA PRIVATE LIMITED. collects, uses, maintains and discloses information collected from users (each, a \"User\") of the <a href=\"www.silvera.co.in\">www.silvera.co.in</a> website (\"Site\"). This privacy policy applies to the Site and all products and services offered by AUSPERA INDIA PRIVATE LIMITED .&nbsp;</p>\r\n<p>Personal identification information</p>\r\n<p>&nbsp;We may collect personal identification information from Users in a variety of ways, including, but not limited to, when Users visit our site, register on the site, place an order, fill out a form, and in connection with other activities, services, features or resources we make available on our Site. Users may be asked for, as appropriate, name, email address, mailing address, phone number. We will collect personal identification information from Users only if they voluntarily submit such information to us. Users can always refuse to supply personally identification information, except that it may prevent them from engaging in certain Site related activities.</p>\r\n<p>&nbsp;</p>\r\n<p>Non-personal identification information</p>\r\n<p>&nbsp;We may collect non-personal identification information about Users whenever they interact with our Site. Non-personal identification information may include the browser name, the type of computer and technical information about Users means of connection to our Site, such as the operating system and the Internet service providers utilized and other similar information.</p>\r\n<p>&nbsp;</p>\r\n<p>Web browser cookies</p>\r\n<p>&nbsp;Our Site may use \"cookies\" to enhance User experience. User\'s web browser places cookies on their hard drive for record-keeping purposes and sometimes to track information about them. User may choose to set their web browser to refuse cookies, or to alert you when cookies are being sent. If they do so, note that some parts of the Site may not function properly.</p>\r\n<p>&nbsp;</p>\r\n<p>How we use collected information</p>\r\n<p>AUSPERA INDIA PVT. LTD. may collect and use Users personal information for the following purposes:</p>\r\n<ul>\r\n<li>- To improve customer service</li>\r\n</ul>\r\n<p>&nbsp;Information you provide helps us respond to your customer service requests and support needs more efficiently.</p>\r\n<ul>\r\n<li>- To personalize user experience</li>\r\n</ul>\r\n<p>&nbsp;We may use information in the aggregate to understand how our Users as a group use the services and resources provided on our Site.</p>\r\n<ul>\r\n<li>- To improve our Site</li>\r\n</ul>\r\n<p>&nbsp;We may use feedback you provide to improve our products and services.</p>\r\n<ul>\r\n<li>- To process payments</li>\r\n</ul>\r\n<p>&nbsp;We may use the information Users provide about themselves when placing an order only to provide service to that order. We do not share this information with outside parties except to the extent necessary to provide the service.</p>\r\n<ul>\r\n<li>- To send periodic emails</li>\r\n</ul>\r\n<p>&nbsp;We may use the email address to send User information and updates pertaining to their order. It may also be used to respond to their inquiries, questions, and/or other requests.</p>\r\n<p>&nbsp;</p>\r\n<p>How we protect your information</p>\r\n<p>&nbsp;We adopt appropriate data collection, storage and processing practices and security measures to protect against unauthorized access, alteration, disclosure or destruction of your personal information, username, password, transaction information and data stored on our Site.</p>\r\n<p>&nbsp;Sensitive and private data exchange between the Site and its Users happens over a SSL secured communication channel and is encrypted and protected.</p>\r\n<p>&nbsp;</p>\r\n<p>Sharing your personal information</p>\r\n<p>&nbsp;We do not sell, trade, or rent Users personal identification information to others. We may share generic aggregated demographic information not linked to any personal identification information regarding visitors and users with our business partners, trusted affiliates and advertisers for the purposes outlined above.</p>\r\n<p>&nbsp;</p>\r\n<p>Security</p>\r\n<p>Please remember that Internet communications are not secure unless the data being sent is encrypted. We cannot accept any responsibility for unauthorised access by a third party or the corruption of data sent to us.</p>\r\n<p>&nbsp;</p>\r\n<p>Changes to this privacy policy</p>\r\n<p>&nbsp;AUSPERA INDIA PVT. LTD. has the discretion to update this privacy policy at any time. When we do, we will revise the updated date at the bottom of this page. We encourage Users to frequently check this page for any changes to stay informed about how we are helping to protect the personal information we collect. You acknowledge and agree that it is your responsibility to review this privacy policy periodically and become aware of modifications.</p>\r\n<p>&nbsp;</p>\r\n<p>Your acceptance of these terms</p>\r\n<p>&nbsp;By using this Site, you signify your acceptance of this policy. If you do not agree to this policy, please do not use our Site. Your continued use of the Site following the posting of changes to this policy will be deemed your acceptance of those changes.</p>\r\n<p>&nbsp;</p>\r\n<p>Contacting us</p>\r\n<p>&nbsp;If you have any questions about this Privacy Policy, the practices of this site, or your dealings with this site, please contact us at:</p>\r\n<p>AUSPERA INDIA PRIVATE LIMITED</p>\r\n<p>127, NSC BOSE ROAD, SOWCARPET</p>\r\n<p>CHENNAI-600003</p>\r\n<p>&nbsp;ph-044-48656229 , e: info@silvera.co.in</p>\r\n<p><a href=\"www.silvera.co.in\">www.silvera.co.in</a></p>', 'N', 0, 1, '2020-06-08 11:01:00', '2020-07-17 13:43:08', 'Privacy Policy', 'Privacy Policy 1', 'Privacy Policy 2'),
