lley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', 'N', 0, 1, '2020-06-08 11:01:00', '2020-06-08 11:01:00', 'Cancellation Policy 1', 'Cancellation Policy 2', 'Cancellation Policy 3'),
(11, 'Cookie Policy', 'cookie-policy', '<div>In this policy we use the term &ldquo;cookies&rdquo; to refer to cookies and other similar technologies covered by the India Directive on privacy in electronic communications.</div>\r\n<div>\r\n<h2>What is a cookie?</h2>\r\n<p>A cookie is a small piece of data that a website asks your browser to store on your computer or mobile device. The cookie allows the website to \"remember\" your actions or preferences over time. Most Internet browsers support cookies; however, users can set their browsers to decline certain types of cookies or specific cookies. Further, users can delete cookies at any time.</p>\r\n<h2>Why do we use cookies?</h2>\r\n<p>We use cookies to learn how you interact with our content and to improve your experience when visiting our website(s). For example, some cookies remember your language or preferences so that you do not have to repeatedly make these choices when you visit one of our websites.</p>\r\n<p>Cookies allow us to serve you specific content, such as videos on our website(s). We may employ the learnings of your behavior on our website(s) to serve you with targeted advertisements on third-party website(s) in an effort to &ldquo;re-market&rdquo; our products and services to you.</p>\r\n<p>What types of cookies do we use?</p>\r\n<h3>First-Party and Third-Party Cookies</h3>\r\n<p>We use both first-party and third-party cookies on our website.</p>\r\n<p>First-party cookies are cookies issued from the silvera.co.in domain that are generally used to identify language and location preferences or render basic site functionality. Third-party cookies belong to and are managed by other parties, such as Silvera business partners or service providers. These cookies may be required to render certain forms, such as the submission of a job application, or to allow for some advertising outside of the Silvera website.</p>\r\n<h3>Session Cookies</h3>\r\n<p>Session cookies are temporary cookies that are used to remember you during the course of your visit to the website, and they expire when you close the web browser.</p>\r\n<h3>Persistent Cookies</h3>\r\n<p>Persistent cookies are used to remember your preferences within the website and remain on your desktop or mobile device even after you close your browser or restart your computer. We use these cookies to analyse user behavior to establish visit patterns so that we can improve our website functionality for you and others who visit our website(s). These cookies also allow us to serve you with targeted advertising and measure the effectiveness of our site functionality and advertising.</p>\r\n<h2>How are cookies used for advertising purposes?</h2>\r\n<p>Cookies and ad technology such as web beacons, pixels, and anonymous ad network tags help us serve relevant ads to you more effectively. They also help us collect aggregated audit data, research, and performance reporting for advertisers. Pixels enable us to understand and improve the delivery of ads to you, and know when certain ads have been shown to you. Since your web browser may request advertisements and web beacons directly from ad network servers, these networks can view, edit, or set their own cookies, just as if you had requested a web page from their site.</p>\r\n<p>Although we do not use cookies to create a profile of your browsing behavior on third-party sites, we do use aggregate data from third parties to show you relevant, interest-based advertising. We do not provide any personal information that we collect to advertisers.</p>\r\n<p>You can opt out of off-site and third-party-informed advertising by adjusting your cookie settings. Opting out will not remove advertising from the pages you visit, but, instead, opting out will result in the ads you see not being matched to your interests. This implies that the ad(s) you see will not be matched to your interests by those specific cookies.</p>\r\n<h2>How are third party cookies used?</h2>\r\n<p>You can choose to reject or block all or specific types of cookies set by virtue of your visit to silvera.co.in website by clicking on the cookie preferences on our website(s). You can change your preferences for silvera.co.in website of any third party suppliers by changing your browser settings. Please note that most browsers automatically accept cookies. Therefore, if you do not wish cookies to be used, you may need to actively delete or block the cookies.</p>\r\n<p>If you reject the use of cookies, you will still be able to visit our websites but some of the functions may not work correctly. You may also visit www.allaboutcookies.org for details on how to delete or reject cookies and for further information on cookies generally. By using our website without deleting or rejecting some or all cookies, you agree that we can place those cookies that you have not deleted or rejected on your device.</p>\r\n</div>\r\n<div>&nbsp;</div>', 'N', 0, 1, '2020-07-06 07:13:10', '2020-07-20 03:01:03', 'Cookie Policy', 'Cookie Policy', 'Cookie Policy'),
(12, 'Return & Exchange', 'return-&-exchange', '<p>EXCHANGE / BUY BACK POLICY</p>\r\n<p>MMTC PAMP 999.9 GOLD COINS - 97 % OF THE FAIR MARKET PRICE</p>\r\n<p>MMTC PAMP 999.9/999.0 SILVER COINS - 98 % OF THE DAILY SPOT RATES UPDATED ON OUR WEBSITE</p>\r\n<p>SILVERA 999.0 SILVER COINS / BARS - 98 % OF THE DAILY SPOT RATES UPDATED ON OUR WEBSITE</p>\r\n<p>NOTE - SHIPPING&nbsp; &amp; INSURANCE COST &amp; RISK TO BE BORNE BY THE SENDER OF THE PRODUCT UNTIL IT REACHES THE BUYER ( AUSPERA INDIA PVT. LTD. ) BUSINESS PREMISES&nbsp; &amp; PRODUCT SHOULD BE ACCOMPANIED WITH ORIGINAL INVOICE</p>\r\n<p>* FAIR MARKET PRICE WILL BE DECIDED ON THE BASIS OF DEMAND AND SUPPLY .</p>', 'N', 0, 1, '2020-07-17 13:48:50', '2020-07-17 13:48:50', 'Return and exchange', 'Return and exchange', 'Return and exchange'),
(13, 'Cancellation Return and Refund policy', 'cancellation-return-and-refund-policy', '<p>&nbsp;</p>\r\n<p><strong>Cancellation Policy:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Q: In how many days/ Hours customers can initiate the cancellation?</strong></p>\r\n<p>Ans. No cancellation allowed except if order is cancelled before dispatch due to non availability of the product.</p>\r\n<p><strong>Q: Once cancellation is approved till when (days) refund will be processed and in how many days amount would be reflected in customer\'s bank account?</strong></p>\r\n<p>Ans. Then refund will be processed in the next 72 hours and it will reflect in customer bank account after 5 business days after processing&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Refund Policy:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Q: In how many days / Hours customers can initiate the Refund &amp; once refund is approved till when (days) refund will be processed and in how many days amount would be reflected in customer\'s bank account?</strong></p>\r\n<p>Ans. No refunds allowed.</p>\r\n<p>&nbsp;</p>\r\n<p><br /><strong>Return Policy:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Q: In how many days/ Hours customers can initiate the Return &amp; once return is approved till when (days) refund will be processed and in how many days amount would be reflected in customer\'s bank account</strong></p>\r\n<p>Ans. No returns accepted.</p>', 'N', 0, 1, '2021-08-10 10:46:05', '2021-08-10 10:49:09', 'Cancellation Return and Refund policy', 'Cancellation Return and Refund policy', 'Cancellation Return and Refund policy');
