(75, 0, NULL, NULL, 138, 141, 0, NULL, 'simple', 'Mom & World Belly Butter with Mango & Cocoa Butter, 100gm - Soften & Moisturizes Stretching Skin  (100)', 'mom-world-belly-butter-with-mango-cocoa-butter-100gm-soften-moisturizes-stretching-skin-100', NULL, '<p>A richly blended belly butter to gently and safely moisturize and nourish mama\'s stretching skin. Mom &amp; World Belly Butter with Pure Cold Pressed oils, Rosehip Oil, Moroccan Argan Oil and Olivates conditions your growing belly with cocoa and mango butter. This natural formula can keep your skin smooth and supple as your belly stretches throughout pregnancy and even post delivery. Safe For Mom And Baby - Mom &amp; World Belly Butter contains no phthalates, parabens, petrolatum, or SLS, and it won\'t irritate your skin so you can use this balm with peace of mind</p>', '<p>delivery within 7 days</p>', '<p>Mom &amp; World Belly Butter with Mango &amp; Cocoa Butter, 100gm - Soften &amp; Moisturizes Stretching Skin&nbsp;&nbsp;(100)</p>', 'YES', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'N', NULL, NULL, 0, '2020-01-01', 'Mom & World Belly Butter with Mango & Cocoa Butter, 100gm - Soften & Moisturizes Stretching Skin  (100)', 'Mom & World Belly Butter with Mango & Cocoa Butter, 100gm - Soften & Moisturizes Stretching Skin  (100)', 'Mom & World Belly Butter with Mango & Cocoa Butter, 100gm - Soften & Moisturizes Stretching Skin  (100)', 'A richly blended belly butter to gently and safely moisturize and nourish mama\'s stretching skin. Mom & World Belly Butter with Pure Cold Pressed oils, Rosehip Oil, Moroccan Argan Oil and Olivates conditions your growing belly with cocoa and mango butter. This natural formula can keep your skin smooth and supple as your belly stretches throughout pregnancy and even post delivery. Safe For Mom And Baby - Mom & World Belly Butter contains no phthalates, parabens, petrolatum, or SLS, and it won\'t irritate your skin so you can use this balm with peace of mind', 0, '0', '0', NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 0, 1, '2022-10-23 08:36:06', '2022-10-23 09:55:18', NULL),
(76, 0, NULL, NULL, 138, 141, 0, NULL, 'simple', 'DEVELO Nostoca Mom Calcium Citrate drinkable powder for pregnant women Protein Shake  (600 g, LEMONADE)', 'develo-nostoca-mom-calcium-citrate-drinkable-powder-for-pregnant-women-protein-shake-600-g-lemonade', NULL, '<div>The time during your pregnancy and the first months of your baby\'s life, when you are breast-feeding, are critical times for both you and your baby to obtain enough calcium. Many of your baby\'s organs depend on calcium to grow properly and adults need calcium to prevent osteoporosis and other health problems. Calcium plays a role in many bodily functions, most importantly bone development and maintenance. Mainly Two forms of calcium exist: calcium citrate and calcium carbonate. Calcium citrate is generally the preferred form, especially when you are pregnant, because it is more easily digested, more readily absorbed into the body and generally causes less constipation A developing baby making the miraculous transformation from tiny embryo to energetic infant needs all sorts of vitamins and minerals, including calcium, to thrive. In addition to helping build strong bones and teeth, calcium also aids in the development of the baby\'s heart, muscles and nerves, and ensures good blood-clotting ability. Your baby takes whatever it needs from you during pregnancy and while breast-feeding, Indian Council of Medical Research (ICMR) recommends 1200 mg/d for pregnant and lactating mothers to meet the increased needs of the baby in the womb and to compensate for calcium secreted in the breast milk. Develo NostoCa MOM offers 1000 mg of elemental calcium from calcium citrate [not 1000 mg of calcium citrate which offers only 210 mg of elemental calcium] and meets 100% RDA for calcium in pregnancy.</div>\r\n<div class=\"_3tLJXl\">&nbsp;</div>', '<p>delivery within 7 days</p>', '<div><span class=\"B_NuCI\">DEVELO Nostoca Mom Calcium Citrate drinkable powder for pregnant women Protein Shake&nbsp;&nbsp;(600 g, LEMONADE)</span></div>\r\n<div class=\"_3tLJXl\">&nbsp;</div>', 'YES', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'N', NULL, NULL, 0, '2020-01-01', 'DEVELO Nostoca Mom Calcium Citrate drinkable powder for pregnant women Protein Shake  (600 g, LEMONADE)', 'DEVELO Nostoca Mom Calcium Citrate drinkable powder for pregnant women Protein Shake  (600 g, LEMONADE)', 'DEVELO Nostoca Mom Calcium Citrate drinkable powder for pregnant women Protein Shake  (600 g, LEMONADE)', 'The time during your pregnancy and the first months of your baby\'s life, when you are breast-feeding, are critical times for both you and your baby to obtain enough calcium. Many of your baby\'s organs depend on calcium to grow properly and adults need calcium to prevent osteoporosis and other health problems. Calcium plays a role in many bodily functions, most importantly bone development and maintenance. Mainly Two forms of calcium exist: calcium citrate and calcium carbonate. Calcium citrate is generally the preferred form, especially when you are pregnant, because it is more easily digested, more readily absorbed into the body and generally causes less constipation A developing baby making the miraculous transformation from tiny embryo to energetic infant needs all sorts of vitamins and minerals, including calcium, to thrive. In addition to helping build strong bones and teeth, calcium also aids in the development of the baby\'s heart, muscles and nerves, and ensures good blood-clotting ability. Your baby takes whatever it needs from you during pregnancy and while breast-feeding, Indian Council of Medical Research (ICMR) recommends 1200 mg/d for pregnant and lactating mothers to meet the increased needs of the baby in the womb and to compensate for calcium secreted in the breast milk. Develo NostoCa MOM offers 1000 mg of elemental calcium from calcium citrate [not 1000 mg of calcium citrate which offers only 210 mg of elemental calcium] and meets 100% RDA for calcium in pregnancy.', 0, '0'