ldren during their travels. Our stroller for kids is an easily portable stroller with a large canopy, a three-angle adjustable seat, an integrated sunshade, two seats with padded seats and fresh air ventilation. The Baby stroller also features a five-point seat belt, removable armrest and footrest that can be adjusted to fit your baby.', 0, '0', '0', NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 0, 1, '2022-11-01 06:40:18', '2022-11-01 06:41:10', NULL),
